import { getConnection } from "./connection";


export async function getResponse(e){
  if(e.target.value){
  let  response =  await getConnection(e.target.value);
  if(response){
 response.req = e.target.value
 response.count= response.suggestions.length
 
 return response;
  }
  return null;
     }
 }
